import style from './NavBranch.module.scss';
import { NavLink } from 'react-router-dom';
import { connect } from 'react-redux';
import {NAV_BAR_CLICK} from '../../../redux/contants/NavBar'

class NavBranch extends Component {
    constructor(props) {
        super(props);
    }
    NavBarSelect = () => {
