        })
    }
    render() {
        return (
            <div className = {style.NavBranch}>
                <div className = "nav-area">
                    <NavLink className = "nav__link" to = "/abc" onClick = {() => this.NavBarSelect()} >
                        <span>Movies</span>
                    </NavLink>
                </div>
            </div>
        )
    }
}

export default connect(null)(NavBranch);
